function updateMarker(lat,lnt,slug,item_title,medium_thumb,symbol,price,i){if(lat!=null){myLatLng=new google.maps.LatLng(lat,lnt);eval('var marker'+i+' = new google.maps.Marker({ position: myLatLng,  map: map, icon: markerimage, zIndex: i});');var embed_url=__cfg('path_relative')+'products/v/slug:'+slug+'/count:false/view_type:2';var product_url=__cfg('path_relative')+'2'+slug;markersArray.push(eval('marker'+i));var contentString='<div style="background:url('+__cfg('path_relative')+'img/seller-background1.png) no-repeat scroll 0 0 transparent;height:78px;margin:0 0px 0px 5px;padding:5px 0 0;position:relative;text-align:center; width:90px;"><img src="'+medium_thumb+'" alt="'+item_title+'" title="'+item_title+'"></div>'+'<span style="background:url(\''+__cfg('path_relative')+'img/seller-caption-bg1.png\') no-repeat scroll 0 0 transparent;float:left;height:31px;line-height:26px;margin:-6px 0 0;text-align:center;width:90px;margin:-4px 0px 0px 5px;font-size:13px;text-align:center;font-family:Arial, Helvetica, sans-serif;color:#555;font-weight:bold">'+symbol+price+'</span>';eval('var infowindow'+i+' = new google.maps.InfoWindow({ content: contentString,  maxWidth: 120});');var infowindow_obj=eval('infowindow'+i);var marker_obj=eval('marker'+i);google.maps.event.addListener(marker_obj,'mouseover',function(){infowindow_obj.open(map,marker_obj);});google.maps.event.addListener(marker_obj,'mouseout',function(){infowindow_obj.close(map,marker_obj);});google.maps.event.addListener(marker_obj,'click',function(){window.location.href=product_url;});}}
function updateProductlist(){$.ajax({type:'GET',url:__cfg('path_relative')+'products/index',data:$('.js-search-map').serialize(),cache:false,beforeSend:function(){$('.js-responses').block();},success:function(responses){$('.js-responses').html(responses);$('.js-responses').unblock();}});}
function bind_calculateProductBuyPrice(){$('input.js-buy-quantity').livequery('keyup',function(){calculateProductBuyPrice();});$('select.js-shipment-country').livequery('change',function(){calculateProductBuyPrice();});$('input.js-buy-quantity').livequery('blur',function(){if(isNaN(this.value)||parseInt(this.value)<=0||this.value==''){this.value=1;}});calculateProductBuyPrice();}
function calculateProductBuyPrice(){is_shipment_cost_required=parseInt($('#is_shipment_cost_required').val());if(isNaN($('.js-buy-quantity').val())||parseInt($('.js-buy-quantity').val())<=0||$('.js-buy-quantity').val()==''){quantity=1;}else{quantity=parseInt($('.js-buy-quantity').val());}
total_ship_cost=0;if(is_shipment_cost_required==1){is_shipment_cost_per_item_or_order=parseInt($('#is_shipment_cost_per_item_or_order').val());shipment_country=parseInt($('.js-shipment-country').val());if(shipment_country!=''){country_ship_cost=__cfg('ShipmentCost')[shipment_country].shipment_cost;total_ship_cost=parseFloat(country_ship_cost);if(is_shipment_cost_per_item_or_order==2){total_ship_cost=quantity*country_ship_cost;}
$('#shipp_amount').html(' '+total_ship_cost.toFixed(2)+' ');$('#shipp_country').html(' '+__cfg('ShipmentCost')[shipment_country].country+' ');}}
remain_quantity=$('#remain_quantity').val();if(remain_quantity!='unlimited'&&quantity>parseInt(remain_quantity)){quantity=parseInt(remain_quantity);this.value=quantity;}
product_price=parseFloat($('#product_price').val());total_amount=product_price*quantity;total_gross_amount_1=total_amount+total_ship_cost;$('#total_buy_amount').html(' '+total_amount.toFixed(2)+' ');$('#total_gross_amount').html(' '+total_gross_amount_1.toFixed(2)+' ');}
if(tout&&1)window._tdump=tout;function updateShipment(){symbol=__cfg('currenies')[$('#currency_id').val()].symbol;$('span.ship-currency-symbol').html(' '+symbol+' ');total_ship_fields=$('div.js-field-list :input').length/2;ship_text='';for(i=0;i<total_ship_fields;i++){var cur=$('#product_ship_country'+i).val();if(cur!=''){if(isNaN($('#product_ship_cost'+i).val())||parseFloat($('#product_ship_cost'+i).val())<=0||$('#product_ship_cost'+i).val()==''){ship_cost=0;}else{ship_cost=parseFloat($('#product_ship_cost'+i).val());}
$('#product_ship_cost'+i).val(ship_cost.toFixed(2));ship_text+=' '+__cfg('countries')[cur]+'('+symbol+' '+ship_cost.toFixed(2)+'),';}}
if(ship_text!=''){ship_text=ship_text.substr(0,ship_text.length-1);$('.js-ship-info').html('This item only ships to:'+ship_text);}else{$('.js-ship-info').html('');}}
function searchLocation(){address=$('#product_address').val();geocoder.geocode({'address':address},function(results,status){if(status==google.maps.GeocoderStatus.OK){marker.setMap(null);map.setCenter(results[0].geometry.location);marker=new google.maps.Marker({draggable:true,map:map,icon:markerimage,position:results[0].geometry.location});infowindow.setContent(results[0].formatted_address);infowindow.open(map,marker);$('#product_latitude').val(marker.getPosition().lat());$('#product_longitude').val(marker.getPosition().lng());google.maps.event.addListener(marker,'dragstart',function(event){infowindow.setContent('Adjusting position...');});google.maps.event.addListener(marker,'dragend',function(event){geocodePosition(marker.getPosition());});}});}